import React from 'react'

export const Paginator = ({pages, pressHandler, page}) => {
    const arrPages = new Array(pages)

    return (
        <div className='paginator-wrapper'>
            {arrPages.map((_, index) => (
                <p key={index} 
                onClick={() => pressHandler(index + 1)}
                className>
                    {index + 1}
                </p>
            ))}
        </div>
    )
}
